  const [error, setError] = useState(null);

  useEffect(() => {
    fetch(`http://localhost:4000/`, {
      'mode': 'no-cors',
      'headers': {
          'Access-Control-Allow-Origin': '*',
      }
  }).then((response) => console.log(response.json));
  }, []);


